import React from "react";
import Header from "./Header";
import Nav from "./Nav";
import Aside from "./Aside";
function Layout(props) {
  return (
    <>
      <Header />
      <Nav />
      <main>{props.children}</main>

    </>
  );
}

export default Layout;
